/* 
1. Fetch data from API https://www.thesportsdb.com/api/v1/json/2/lookupplayer.php?id=34162040
2. The result should be like this: https://www.thesportsdb.com/player/34162040
*/




import React from "react";


export default class JugadoresPagina extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            Jugadores: []
        }

    }

    componentDidMount() {
        fetch("https://www.thesportsdb.com/api/v1/json/2/lookupplayer.php?id=34162040")
        .then(response => response.json())
        .then(data => {
            this.setState({
                Jugadores: data.player
            });
        })
    }

    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col">
                        <section class="header-liga">
                            <div class="container justify-content-center align-items-center">
                                <div class="row justify-content-between">
                                    <div class="col-lg-3 d-flex flex-row justify-content-center align-items-center">
                                        <div class="header-left">
                                            <p class="text"> Pr√≥ximos partidos </p>
                                        </div>
                                    </div>
                                    <div class="col-lg-3 mx-5">
                                        <div class="header">
                                            <p class="text"> Real Madrid </p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </section>
                        <table className="table table-striped">
                            <thead>
                                <tr>
                                    <th scope="col">Fecha</th>
                                    <th scope="col">Local</th>
                                    <th scope="col">Visitante</th>
                                </tr>
                            </thead>
                            <tbody>
                                {this.state.Jugadores.map((jugador) => (
                                    <tr>
                                        <td>{jugador.date}</td>
                                        <td>{jugador.homeTeam}</td>
                                        <td>{jugador.awayTeam}</td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        )
    }
}
